import{_ as e,c as t,o as i,af as s}from"./chunks/framework.-p1xHJtd.js";const c=JSON.parse(`{"title":"常见问题","description":"","frontmatter":{"head":[["script",{},"\\n      if (typeof tianliGPT_key === 'undefined') {\\n        window.tianliGPT_key = 'P-915FBDZX7U944XJF';\\n        window.tianliGPT_postSelector = '#VPContent .container > .content';\\n        window.tianliGPT_Title = '文章摘要';\\n        window.tianliGPT_postURL = '*';\\n        window.tianliGPT_blacklist = '';\\n        window.tianliGPT_wordLimit = '10000';\\n        window.tianliGPT_typingAnimate = true;\\n        window.tianliGPT_theme = 'default';\\n        window.tianliGPT_BeginningText = '这篇文章介绍了';\\n        window.postChatConfig = {\\n            backgroundColor: \\"#3e86f6\\",\\n  fill: \\"#FFFFFF\\",\\n  bottom: \\"16px\\",\\n  left: \\"16px\\",\\n  width: \\"44px\\",\\n  defaultInput: false,\\n  upLoadWeb: true,\\n  showInviteLink: true,\\n  addButton: true,\\n  userTitle: \\"智能助手\\",\\n  userDesc: \\"如果你对部署的内容有任何疑问，可以来问我哦～\\",\\n  userIcon: \\"\\",\\n  defaultChatQuestions: [\\n    \\"如何部署这个项目？\\",\\n    \\"如何配置图床？\\",\\n    \\"文章列表没有刷新？\\",\\n    \\"忘记密码怎么办？\\"\\n  ]\\n        };\\n      }\\n    "],["script",{"src":"https://ai.tianli0.top/static/public/postChatUser.min.js","defer":"true","data-postChat_key":"P-915FBDZX7U944XJF"}]]},"headers":[],"relativePath":"start/questions.md","filePath":"start/questions.md","lastUpdated":1768223172000}`),n={name:"start/questions.md"};function o(r,a,l,h,d,p){return i(),t("div",null,[...a[0]||(a[0]=[s(`<h1 id="常见问题" tabindex="-1">常见问题 <a class="header-anchor" href="#常见问题" aria-label="Permalink to &quot;常见问题&quot;">​</a></h1><h2 id="什么是-api-密钥" tabindex="-1">什么是 API 密钥 <a class="header-anchor" href="#什么是-api-密钥" aria-label="Permalink to &quot;什么是 API 密钥&quot;">​</a></h2><p>在您完成初始化之后可在设置界面修改/创建 API 密钥, 用于 Webhook 中的身份验证。若留空系统会随机生成一个 API 密钥</p><h2 id="为什么我新建的文章没有显示-qexo-如何保证文件最新" tabindex="-1">为什么我新建的文章没有显示 | Qexo 如何保证文件最新 <a class="header-anchor" href="#为什么我新建的文章没有显示-qexo-如何保证文件最新" aria-label="Permalink to &quot;为什么我新建的文章没有显示 | Qexo 如何保证文件最新&quot;">​</a></h2><p>Qexo 为了加快访问速度引进了缓存机制, 你可以在设置清除缓存 &amp; 设置 Webhook自动清除缓存</p><h2 id="webhook-是什么" tabindex="-1">Webhook 是什么 <a class="header-anchor" href="#webhook-是什么" aria-label="Permalink to &quot;Webhook 是什么&quot;">​</a></h2><p>Qexo 中的 Webhook 指 /api/webhook 用于自动化操作, 目前可用于自动清除缓存</p><h2 id="安装后出现-504-time-out" tabindex="-1">安装后出现 504 Time out <a class="header-anchor" href="#安装后出现-504-time-out" aria-label="Permalink to &quot;安装后出现 504 Time out&quot;">​</a></h2><ol><li>您的数据库没有正确配置或没有允许所有 IP 白名单访问, 可在 MongoDB 控制台进行修改, 修改完成后<strong>一定要重新部署</strong></li><li>删除并重建数据库, 注意区域<strong>一定要选择 AWS / N. Virginia (us-east-1)</strong></li></ol><h2 id="安装-更新后出现-5xx-错误" tabindex="-1">安装/更新后出现 5xx 错误 <a class="header-anchor" href="#安装-更新后出现-5xx-错误" aria-label="Permalink to &quot;安装/更新后出现 5xx 错误&quot;">​</a></h2><p>Qexo 每个 Release 都经过 Dev 分支的测试, 一般情况下不会出现较大问题, 如果你遇到了500等错误, 请尝试以下步骤</p><ol><li>检查数据库配置</li><li>清除浏览器缓存 / 程序缓存</li><li>在 <code>/settings.html</code> 页面检查 博客程序 服务商配置并点击保存</li><li>在 <code>/advanced.html</code> 中点击“修复”按钮</li><li>若无法登录请使用API: <code>/pub/fix?token=(Your API Key)</code></li><li>保留数据库配置的环境变量并重新部署</li><li>重新部署整个程序</li><li>尝试 Dev 分支</li></ol><h2 id="assertionerror-xxx-object-its-id-attribute-is-set-to-none" tabindex="-1">AssertionError(&quot;xxx object ... its id attribute is set to None.&quot;) <a class="header-anchor" href="#assertionerror-xxx-object-its-id-attribute-is-set-to-none" aria-label="Permalink to &quot;AssertionError(&quot;xxx object ... its id attribute is set to None.&quot;)&quot;">​</a></h2><p>请检查你是否曾使用过0.01或0.1版本, 这两个版本有严重问题, 请重新创建数据库并部署</p><h2 id="如何创建子目录下的文章" tabindex="-1">如何创建子目录下的文章 <a class="header-anchor" href="#如何创建子目录下的文章" aria-label="Permalink to &quot;如何创建子目录下的文章&quot;">​</a></h2><p>在文章名一栏填写 dir/filename 例如您希望创建 source/_posts/about/me.md 则需要输入 about/me</p><h2 id="keyerror-xxx" tabindex="-1">KeyError: &#39;XXX&#39; <a class="header-anchor" href="#keyerror-xxx" aria-label="Permalink to &quot;KeyError: &#39;XXX&#39;&quot;">​</a></h2><p>表示并没有获取到 &quot;XXX&quot; 这个环境变量, 请根据表格添加后 Redeploy</p><table tabindex="0"><thead><tr><th>名称</th><th>意义</th><th>示例</th></tr></thead><tbody><tr><td>MONGODB_HOST</td><td>MongoDB 数据库连接地址</td><td>mongodb+srv://cluster0.xxxx.mongodb.net</td></tr><tr><td>MONGODB_PORT</td><td>MongoDB 数据库通信端口 默认应填写 27017</td><td>27017</td></tr><tr><td>MONGODB_USER</td><td>MongoDB 数据库用户名</td><td>abudu</td></tr><tr><td>MONGODB_DB</td><td>MongoDB 数据库名</td><td>Cluster0</td></tr><tr><td>MONGODB_PASS</td><td>MongoDB 数据库密码</td><td>JWo0xxxxxxxx</td></tr></tbody></table><h2 id="github-配置校验错误" tabindex="-1">Github 配置校验错误 <a class="header-anchor" href="#github-配置校验错误" aria-label="Permalink to &quot;Github 配置校验错误&quot;">​</a></h2><p>如果配置中遇到问题, 可以访问 <a href="https://hexoplusplus.cronfly.workers.dev/?step=start" target="_blank" rel="noreferrer">HPP校验助手</a> 自检配置, 若确认无误, 可检查仓库内是否有已经发布的文章</p><p>注意：Github 仓库一定为您 博客源码 <strong>自动化部署</strong>所在的仓库</p><h2 id="vercel-用量问题" tabindex="-1">Vercel 用量问题 <a class="header-anchor" href="#vercel-用量问题" aria-label="Permalink to &quot;Vercel 用量问题&quot;">​</a></h2><p>Vercel 的无服务器函数用量对于 Qexo 来说是充裕的, 但这依然抵挡不住有心之人的攻击行为, 所以要保护好自己后台地址, 不过好在 Vercel 不会随意扣费, 所以在资源用完之后并不会产生费用, 若依然不放心可以考虑部署在自己的服务器上 <a href="https://github.com/am-abudu/Qexo/wiki/%E6%9C%8D%E5%8A%A1%E5%99%A8%E9%83%A8%E7%BD%B2" target="_blank" rel="noreferrer">#服务器部署#</a></p><h2 id="在线更新失败了" tabindex="-1">在线更新失败了 <a class="header-anchor" href="#在线更新失败了" aria-label="Permalink to &quot;在线更新失败了&quot;">​</a></h2><p>检查高级设置中的 VERCEL_TOKEN 和 PROJECT_ID 是否正确为 Qexo 的部署项目</p><h2 id="我的-cdn-出现问题" tabindex="-1">我的 CDN 出现问题 <a class="header-anchor" href="#我的-cdn-出现问题" aria-label="Permalink to &quot;我的 CDN 出现问题&quot;">​</a></h2><p>如果你使用的是 <code>.top</code> 域名, 请你不要尝试使用 CNPM 作为 CDN 源, 这会产生致命问题。如果悲剧已经发生, 请使用命令行恢复:</p><div class="language-shell vp-adaptive-theme line-numbers-mode"><button title="Copy Code" class="copy"></button><span class="lang">shell</span><pre class="shiki shiki-themes github-light github-dark vp-code" tabindex="0"><code><span class="line"><span style="--shiki-light:#6F42C1;--shiki-dark:#B392F0;">python</span><span style="--shiki-light:#032F62;--shiki-dark:#9ECBFF;"> manage.py</span><span style="--shiki-light:#032F62;--shiki-dark:#9ECBFF;"> shell</span></span></code></pre><div class="line-numbers-wrapper" aria-hidden="true"><span class="line-number">1</span><br></div></div><p>然后运行Python脚本即可</p><div class="language-python vp-adaptive-theme line-numbers-mode"><button title="Copy Code" class="copy"></button><span class="lang">python</span><pre class="shiki shiki-themes github-light github-dark vp-code" tabindex="0"><code><span class="line"><span style="--shiki-light:#D73A49;--shiki-dark:#F97583;">from</span><span style="--shiki-light:#24292E;--shiki-dark:#E1E4E8;"> hexoweb.functions </span><span style="--shiki-light:#D73A49;--shiki-dark:#F97583;">import</span><span style="--shiki-light:#24292E;--shiki-dark:#E1E4E8;"> get_setting, save_setting</span></span>
<span class="line"><span style="--shiki-light:#24292E;--shiki-dark:#E1E4E8;">save_setting(</span><span style="--shiki-light:#032F62;--shiki-dark:#9ECBFF;">&#39;CDN_PREV&#39;</span><span style="--shiki-light:#24292E;--shiki-dark:#E1E4E8;">, </span><span style="--shiki-light:#032F62;--shiki-dark:#9ECBFF;">&quot;https://unpkg.com/qexo-static@</span><span style="--shiki-light:#005CC5;--shiki-dark:#79B8FF;">{version}</span><span style="--shiki-light:#032F62;--shiki-dark:#9ECBFF;">/qexo&quot;</span><span style="--shiki-light:#24292E;--shiki-dark:#E1E4E8;">)</span></span></code></pre><div class="line-numbers-wrapper" aria-hidden="true"><span class="line-number">1</span><br><span class="line-number">2</span><br></div></div><h2 id="忘记管理员密码" tabindex="-1">忘记管理员密码 <a class="header-anchor" href="#忘记管理员密码" aria-label="Permalink to &quot;忘记管理员密码&quot;">​</a></h2><p>如果你很不幸忘记了自己的管理员密码, 修改密码可以直接使用自带的命令行</p><div class="language-shell vp-adaptive-theme line-numbers-mode"><button title="Copy Code" class="copy"></button><span class="lang">shell</span><pre class="shiki shiki-themes github-light github-dark vp-code" tabindex="0"><code><span class="line"><span style="--shiki-light:#6F42C1;--shiki-dark:#B392F0;">python</span><span style="--shiki-light:#032F62;--shiki-dark:#9ECBFF;"> manage.py</span><span style="--shiki-light:#032F62;--shiki-dark:#9ECBFF;"> changepassword</span><span style="--shiki-light:#24292E;--shiki-dark:#E1E4E8;"> [user_name]</span></span></code></pre><div class="line-numbers-wrapper" aria-hidden="true"><span class="line-number">1</span><br></div></div><h2 id="无法登录-网络错误" tabindex="-1">无法登录(网络错误) <a class="header-anchor" href="#无法登录-网络错误" aria-label="Permalink to &quot;无法登录(网络错误)&quot;">​</a></h2><p>请检查浏览器控制台的错误信息, 一般是由于域名配置错误导致的</p><p>新版本优化了安全措施, 请确认你在环境变量中正确配置了 DOMAINS 变量, 例如:</p><div class="language-yaml vp-adaptive-theme line-numbers-mode"><button title="Copy Code" class="copy"></button><span class="lang">yaml</span><pre class="shiki shiki-themes github-light github-dark vp-code" tabindex="0"><code><span class="line"><span style="--shiki-light:#22863A;--shiki-dark:#85E89D;">DOMAINS</span><span style="--shiki-light:#24292E;--shiki-dark:#E1E4E8;">: [</span><span style="--shiki-light:#032F62;--shiki-dark:#9ECBFF;">&quot;yourdomain.com&quot;</span><span style="--shiki-light:#24292E;--shiki-dark:#E1E4E8;">,</span><span style="--shiki-light:#032F62;--shiki-dark:#9ECBFF;">&quot;www.yourdomain.com&quot;</span><span style="--shiki-light:#24292E;--shiki-dark:#E1E4E8;">]</span></span></code></pre><div class="line-numbers-wrapper" aria-hidden="true"><span class="line-number">1</span><br></div></div><h2 id="其他问题" tabindex="-1">其他问题 <a class="header-anchor" href="#其他问题" aria-label="Permalink to &quot;其他问题&quot;">​</a></h2><p>如果还有问题, 可以发 <a href="https://github.com/am-abudu/Qexo/issues" target="_blank" rel="noreferrer">issue</a> 或加入 <a href="https://jq.qq.com/?_wv=1027&amp;k=rAcnhzqK" target="_blank" rel="noreferrer">HexoPlusPlus交流群</a> 询问</p><p>如果你无法通过链接添加 QQ 群, 请使用群号<code>467731779</code></p>`,41)])])}const k=e(n,[["render",o]]);export{c as __pageData,k as default};
